import React from 'react';
import stylesOrder from './Order.module.css';

import { CloseIcon } from '@ya.praktikum/react-developer-burger-ui-components'
import AcceptIcon from '../UI/AcceptIcon/AcceptIcon'

const Order = () => {
  return (
    <div className={stylesOrder.wrapper}>
        <CloseIcon type="primary" />
        <p className="text text_type_digits-large">1234567890</p>
        <p className="text text_type_main-medium">The quick brown fox jumps over the lazy dog.</p>
        <AcceptIcon />
        <p className="text text_type_main-default">The quick brown fox jumps over the lazy dog.</p>
        <p className="text text_type_main-default text_color_inactive">The quick brown fox jumps over the lazy dog.</p>
    </div>
  )
}

export default Order
